import React from 'react'

const AppSearch = () => {
    return ( 
      <span className='app-search justify-content-between'>
        <input type="text" name="" id="" placeholder="SOME"/>
        <span>
          <button className='btn btn-info' type="button"></button>
          <button type="button"></button>
          <button type="button"></button>
        </span>
      </span>
    );
  };

  export default AppSearch;
